	global	_start

_start:
	call	create_file
	cmp	rax, 0
	je	.terminate			; x = 0
	call	dr_quine_01
	;compile db "gcc -o Sully_X Sully_X.c", 0 
	;exec db "./Sully_X", 0
	mov	r12b, byte [rel X]
	mov	byte [rel compile + 13], r12b
	mov 	byte [rel compile + 21], r12b
	mov	byte [rel exec + 8], r12b
	mov	rdi, [rel compile]
	mov	rax, 1;system call number
	;;call system(compile)
	mov	rdi, [rel compile]
	mov	rax, 1;system call number
	;;call	system(exec)	
	.terminate:
	mov	rax, 60	
	mov	rax, 0x2000001	
	syscall

create_file:
	mov	rax, [rel X]
	cmp	rax, 0
	je	.return
	push	rdi
	push	rsi
	mov	rdi, [rsp + 8]
	mov	rsi, "./Sully"
	call	ft_strcmp
	cmp	rax, 0
	je	.move
	mov	rax, [rel X]
	dec	rax
	.move:
	mov	rax, [rel X]
	add	rax, 48
	lea	rdi, [rel filename]
	mov	[rdi + 6], byte al
	;mov	rax, 2
	mov	rax, 0x2000005
	lea	rdi, [rel filename]
	mov	rsi, 0x601
	mov	rdx, 0o644
	syscall
	mov [rel fd], rax
	ret
	.return:
	mov	rax, 0
	ret

dr_quine_01:

	xor	r15, r15
	xor	r9, r9
	xor	rcx, rcx

	lea	r15, [rel prog]
	mov	r13, [rel borders1]
	mov	r14, [rel borders2]

	.dr_start_loop:

		;mov	dil, [r15 + rcx]
		movzx	edi, byte [r15 + rcx]
		cmp	dil, 0
		je	.done

		cmp	r9, 0
		je	.print_char
		jmp	.print_nbr

	.print_char:
		cmp	rcx, r13
		je	.reprint
		push	rax
		push	rdx
		push	rsi
		push	rdi
		push	rcx
		call	ft_putchar
		pop	rcx
		pop	rdi
		pop	rsi
		pop	rdx
		pop	rax
		jmp     .continue

	.print_nbr:

		push	rax
		push	rsi
		push	rdi
		push	rdx
		push	rcx
		call	ft_putnbr
		cmp	rcx, 3296
		je	.move
		mov	dil, 44
		call	ft_putchar
		mov	dil, 32
		call	ft_putchar
		.move:
		pop	rcx
		pop	rdx
		pop	rdi
		pop	rsi
		pop	rax
		jmp     .continue

		.reprint:
		mov	rcx,0
		mov	r9, 1
		jmp	.dr_start_loop


	.continue:
	inc	rcx
	jmp	.dr_start_loop

	.done:
	mov	dil, 48
	call	ft_putchar
	mov	dil, 10
	call	ft_putchar
	call	ft_print_x
	ret


ft_print_x:
	
	mov	rax, [rel X]
	dec	rax
	add	rax, 48
	lea	rsi, [rel x_buff]
	mov	[rsi + 5], byte al 
	mov	rax, 0X2000004
	mov	rdi, [rel fd]
	mov	rdx, 7
	syscall
	ret

ft_putnbr:

	push	rbx
	push	rcx
	push	r10
	push	r11
	push	r12
	push	r13
	push	r14
	xor	r14, r14
	xor	r12, r12
	xor	r10, r10
	mov	ebx, 0xA
	lea	r11, [rel tmp_nbr]


	mov	eax, edi
	cmp	eax, 0x0
	jge	.nbr_loop_start
	cmp	eax, -2147483648
	je	.handle_min_int
	neg	eax
	mov	r10, 1
	jmp	.nbr_loop_start

	.handle_min_int:
	mov	r10, 1
	lea	rsi, [rel nbr]
	mov	dword [rsi], "-214"
	mov	dword [rsi+4], "7483"
	mov	dword [rsi+8], "648"
	mov	byte [rsi+11], 0
	mov	rax, rsi
	jmp	.return

	.nbr_loop_start:
		cdq
		div	ebx
		add	dl, '0'
		mov	[r11 + r14], byte dl
		inc	r14
		cmp	eax, 0x0
		je	.nbr_loop_end

		jmp	.nbr_loop_start

	.nbr_loop_end:
	lea	rsi , [rel nbr]
	cmp	r10, 1
	jne	.nbr_flip_loop_start
	mov	[r11 + r14], byte '-'
	inc	r14

	;flip string
	.nbr_flip_loop_start:
		cmp	r14, 0
		je	.nbr_flip_loop_end

		mov	r13b, byte [r11 + r14 - 1]
		mov	[rsi + r12], byte r13b
		inc	r12
		dec	r14

		jmp	.nbr_flip_loop_start

	.nbr_flip_loop_end:
	mov	[rsi + r12] , byte 0
	mov	rax, rsi
	;print nbr
	push	r12
	xor	r12, r12

	.putstr_loop_start:

		mov	dl, byte[rsi + r12]
		cmp	dl, 0x0
		je	.putstr_loop_end

		mov	dil, dl
		push	rdi
		push	rsi
		push	rdx
		push	rax
		call	ft_putchar
		pop	rax
		pop	rdx
		pop	rsi
		pop	rdi

		inc	r12

		jmp	.putstr_loop_start

	.putstr_loop_end:
	pop	r12

	.return:
	pop	r14
	pop	r13
	pop	r12
	pop	r11
	pop	r10
	pop	rcx
	pop	rbx
	ret


ft_putchar:

	mov	[rel charbuffer], dil
	mov	rax, 0X2000004
	mov	rdi, [rel fd]
	lea	rsi, [rel charbuffer]
	mov	rdx, 1
	syscall
	ret

ft_strcmp:

	push	rcx
	xor	rcx, rcx
	xor	rax, rax

	.strcmp_loop_start:
		xor	rax, rax
		xor	rdx, rdx
		mov	al, [rdi + rcx]
		mov	dl, [rsi + rcx]

		cmp	al, dl
		jne	.strcmp_loop_end

		test	al,al
		jz	.strcmp_loop_end

		inc	rcx
		jmp	.strcmp_loop_start

	.strcmp_loop_end:

	push	rdx
	xor	rax, rax
	xor	rdx, rdx
	mov	eax,	al
	mov	edx,	dl
	sub	eax, edx
	pop	rdx
	pop	rcx
	ret


ft_strcat:

	push	r12
	push	r13
	push	rdx
	xor	r12
	xor	r13

	cmp	rsi, 0
	.return
	
	.strcat_start_loop:
	mov	dl, [rdi + r12]
	cmp	dl, 0
	je	.move_end_src:
	inc	r12
	jmp	.strcat_start_loop

	.move_end_src:
	mov	dl, [rsi + r13]
	mov	[rdi + r12], dl
	cmp	dl, 0
	je	.return
	inc	r12
	inc	r13
	jmp	.move_end_src	

	.return:
	pop	rdx
	pop	r13
	pop	r12
	mov	rax, rdi
	ret

